  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0114477 includes Surface
  underway, chemical, meteorological and physical data collected from ANTARES in the
  North Atlantic Ocean and South Atlantic Ocean from 2009-03-20 to 2010-08-06 and
  retrieved during cruise 14AT20090320. These data include BAROMETRIC PRESSURE, Partial
  pressure (or fugacity) of carbon dioxide - atmosphere, Partial pressure (or fugacity)
  of carbon dioxide - water, SALINITY and SEA SURFACE TEMPERATURE. The instruments
  used to collect these data include Carbon dioxide (CO2) gas analyzer and Shower
  head chamber equilibrator for autonomous carbon dioxide (CO2) measurement. These
  data were collected by Nathalie Lefevre of Universite Pierre et Marie Curie; Institut
  Pierre Simon Laplace; Laboratoire D'Oceanographie et du Climat: Experimentations
  et Approches Numeriques as part of the TS_PIRATA8N38W data set.\",\n\t\"owner_org\":
